import React from 'react';

const CObs = () => {

    const [dado, setDado] = React.useState();

    const EnvioDados = (e) => {
        e.preventDefault()
        console.log('enviado', dado)
    }

    return (
        <div className='tela--geral'>
            <div className='tela--consulta'>
                <h1>Correção de Município</h1>
                <form onClick={EnvioDados}>
                    <label>teste: </label>
                    <input onChange={(e) => setDado(e.target.value)} placeholder='teste' type='text' />
                    <button>enviar</button>
                </form>
            </div>
        </div>
    )

}
export default CObs
